import './index.css'

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-heading">BIAB</div>
      <div className="navbar-search">
        <input type="text" placeholder="Search for people, communities, code and more..." />
      </div>
      <div className="navbar-profile">
        <div className="profile-photo"> {/* Your user profile photo goes here */}</div>
        <div className="profile-dropdown">
          <span className="dropdown-icon">&#9776;</span>
          <div className="dropdown-content">
            <p>Name</p>
            <p>Email</p>
            <p>Logout</p>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
